import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

import Main from '../Main/Main'

const Routes = () => {
    return (
        <div>
            <Switch>
                <Route exact path="/">
                    <Main />
                </Route>
                <Route path="/NavBar" render={ function() {
                    return <h1>not found</h1> 
                }} />
            </Switch>
        </div>
    )
}

export default Routes
